import React from "react";
import styled from "styled-components";
import back_img from "../../assets/img/login_back.jpg";

// Login Background Part
const LoginLeftContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  width: calc(100% / 1.5);
  height: 100%;
  background-image: url(${back_img});
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  position: relative;
  &::before {
    position: absolute;
    content: "";
    width: 100%;
    height: 100vh;
    background-color: rgba(32, 29, 64, 0.5);
    top: 0;
    left: 0;
    z-index: 0;
  }
`;

// Login Sentences Style
const Welcome = styled.div`
  position: relative;
  letter-spacing: 0.5rem;
  word-spacing: 1rem;
  font-size: 5rem;
  color: #ffffff;
  text-transform: uppercase;
  position: relative;
  &::before {
    position: absolute;
  }
`;

export const LoginLeft = () => {
  return (
    <LoginLeftContainer>
      <Welcome>welcome page</Welcome>
    </LoginLeftContainer>
  );
};
